import { ADD_CELL, REMOVE_CELL } from "./actionTypes"


export const addCell = (day_id, category_name, cell_name) => ({
    type: ADD_CELL,
    payload: {
        day_id: day_id,
        category_name: category_name,
        cell_name: cell_name
    }
})

export const removeCell = (day_id, category_name, cell_name) => ({
    type: REMOVE_CELL,
    payload: {
        day_id: day_id,
        category_name: category_name,
        cell_name: cell_name
    }
})
